<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>2FA Authenticator</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: #0a0a0a;
            color: #fff;
            min-height: 100vh;
            padding: 40px 20px;
        }

        .container {
            max-width: 480px;
            margin: 0 auto;
        }

        .header {
            margin-bottom: 40px;
        }

        .header h1 {
            font-size: 24px;
            font-weight: 600;
            margin-bottom: 6px;
        }

        .header p {
            color: #888;
            font-size: 14px;
        }

        .login-screen {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: #0a0a0a;
            display: flex;
            align-items: center;
            justify-content: center;
            z-index: 1000;
        }

        .login-box {
            text-align: center;
            max-width: 320px;
            width: 100%;
            padding: 20px;
        }

        .login-box h2 {
            font-size: 20px;
            margin-bottom: 30px;
            font-weight: 500;
        }

        input {
            width: 100%;
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            color: #fff;
            padding: 14px 16px;
            border-radius: 8px;
            font-size: 15px;
            margin-bottom: 12px;
            transition: all 0.2s;
        }

        input:focus {
            outline: none;
            border-color: #fff;
        }

        input::placeholder {
            color: #666;
        }

        .btn {
            width: 100%;
            background: #fff;
            color: #000;
            border: none;
            padding: 14px;
            border-radius: 8px;
            font-size: 15px;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.2s;
        }

        .btn:hover {
            background: #e0e0e0;
        }

        .btn:active {
            transform: scale(0.98);
        }

        .btn-secondary {
            background: #1a1a1a;
            color: #fff;
            border: 1px solid #2a2a2a;
            margin-top: 8px;
        }

        .btn-secondary:hover {
            background: #2a2a2a;
        }

        .add-section {
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            border-radius: 12px;
            padding: 20px;
            margin-bottom: 24px;
        }

        .add-section h2 {
            font-size: 16px;
            font-weight: 500;
            margin-bottom: 16px;
        }

        .input-group {
            margin-bottom: 12px;
        }

        .input-group label {
            display: block;
            font-size: 13px;
            color: #888;
            margin-bottom: 6px;
        }

        .accounts-grid {
            display: grid;
            gap: 12px;
        }

        .account-card {
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            border-radius: 12px;
            padding: 20px;
            position: relative;
        }

        .account-header {
            display: flex;
            justify-content: space-between;
            align-items: flex-start;
            margin-bottom: 16px;
        }

        .account-info h3 {
            font-size: 15px;
            font-weight: 500;
            margin-bottom: 4px;
        }

        .account-info span {
            font-size: 13px;
            color: #666;
        }

        .delete-btn {
            background: none;
            border: none;
            color: #666;
            cursor: pointer;
            font-size: 18px;
            padding: 0;
            width: 24px;
            height: 24px;
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 4px;
            transition: all 0.2s;
        }

        .delete-btn:hover {
            background: #2a2a2a;
            color: #fff;
        }

        .code-section {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .code {
            font-size: 28px;
            font-weight: 600;
            letter-spacing: 4px;
            font-family: 'SF Mono', 'Monaco', monospace;
        }

        .timer-circle {
            width: 36px;
            height: 36px;
            position: relative;
        }

        .timer-text {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 13px;
            font-weight: 600;
        }

        .timer-circle svg {
            transform: rotate(-90deg);
        }

        .timer-circle circle {
            fill: none;
            stroke: #2a2a2a;
            stroke-width: 3;
        }

        .timer-circle .progress {
            stroke: #fff;
            stroke-linecap: round;
            transition: stroke-dashoffset 1s linear;
        }

        .timer-circle.warning .progress {
            stroke: #ff4444;
        }

        .empty-state {
            text-align: center;
            padding: 60px 20px;
            color: #666;
        }

        .actions {
            display: flex;
            gap: 8px;
            margin-top: 16px;
        }

        .actions button {
            flex: 1;
            padding: 12px;
            font-size: 14px;
        }

        .hint {
            font-size: 12px;
            color: #666;
            margin-top: 8px;
            line-height: 1.5;
        }

        .lock-btn {
            position: fixed;
            bottom: 24px;
            right: 24px;
            width: 48px;
            height: 48px;
            border-radius: 50%;
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            color: #fff;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            font-size: 20px;
            transition: all 0.2s;
        }

        .lock-btn:hover {
            background: #2a2a2a;
        }

        #importFile {
            display: none;
        }
    </style>
</head>
